package org.tnsif.operator;

public class LogicalOperatorDemo {

	@SuppressWarnings("unused")
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(31!=7 && 3>=5);
		System.out.println(31!=7 || 3>=5);
		System.out.println(!(31!=7 || 3>=5));
		System.out.println(!(31!=7 && 3>=5));
	}

}
